function Form(){

    const submitHandler = (event) => {
      event.preventDefault()
    }

    return(
      <Form onSubmit = {submitHandler}>
          <div>
          <label>Task - No.</label>
          <input type = 'number' name = 'no'></input>
          </div>

          <div>
          <label> Task </label>
          <input type ='text' name = 'task'></input>
          </div>

          <div>
          <button type = 'submit'> Add </button>  
           </div> 
      </Form>
    );

};

export default Form;
